function init(){SXE.initElementDialog("del");if(SXE.currentAction=="update"){setFormValue("datetime",tinyMCEPopup.editor.dom.getAttrib(SXE.updateElement,"datetime"));setFormValue("cite",tinyMCEPopup.editor.dom.getAttrib(SXE.updateElement,"cite"));SXE.showRemoveButton()}}function setElementAttribs(a){setAllCommonAttribs(a);setAttrib(a,"datetime");setAttrib(a,"cite");a.removeAttribute("data-mce-new")}
function insertDel(){var a=tinyMCEPopup.editor.dom.getParent(SXE.focusElement,"DEL");if(a==null){if(SXE.inst.selection.getContent().length>0){insertInlineElement("del");for(var c=SXE.inst.dom.select("del[data-mce-new]"),b=0;b<c.length;b++){a=c[b];setElementAttribs(a)}}}else setElementAttribs(a);tinyMCEPopup.editor.nodeChanged();tinyMCEPopup.execCommand("mceEndUndoLevel");tinyMCEPopup.close()}function removeDel(){SXE.removeElement("del");tinyMCEPopup.close()}tinyMCEPopup.onInit.add(init);
